Memo Akten (memo.tv), 2021;
An exploration into the minds of an artificial, and a biological, neural network. 
Continuing on from my "Journey through the layers of the mind" (2015), "Learning to See" (2017-) and "Deep Meditations" series (2018-); continuing investigations into *Deep Visual Instruments* for *Latent Story-telling* - Deep Learning models as an artistic medium for new modes of performative, creative expression with abstract narrative.
Created using custom software using VQGAN+CLIP.
